import React, { Component } from 'react';
import { Link } from 'react-router-dom';
import {Card,Button} from '@material-ui/core';

class Login extends Component {
    render() {
        return (
            <div>
                 <Card><h1>Hello app</h1></Card>  
            </div>
        );
    }
}

export default Login;
